    const club = props.especClub.map((member, i) => {
        return (
            <li>
               {member} 
            </li>
        )
    } 

    );    

  return (
      <article>
          <h2>{props.especClub.name}</h2>
          <i className={props.especClub.fa}></i>
          <ul>
              {club}
          </ul>
      </article>

  );
}

export default Club;
